import React from "react";
import  Api  from "./api";



const Interview = () => {
    return (
        <>
            {
                Api.map((e)=>{
                    const [id , Q] = e;
                    <h1>{e.Q}</h1>
                })
            }
        </>
    )
}

export default Interview;
